import React from 'react';
import { useState } from 'react/cjs/react.development';
import './index.css';
function App(){
    const [name,set]=useState();
    function Nav(){
        return (<>
            <div className='nav'>
                <h2>This is mine</h2>
            </div>
        </>);
    }
    function Click(event){
        console.log(event);

    }
    function Input(){
        <>
        <h1>Hello {name}</h1>
        <input placeholder='Enter the Name' type="text" value='' onChange={Click}></input>
        <button className='button'  >Click Me</button>
        </>
    }
    return <>
        <Input/>
        <Nav/>
    </>
}

export default App;
